import './App.css';
import { Route, Routes } from 'react-router-dom';
import React from 'react';

import Post from './post/PagePost';
import Read from './post/PageLoad';

import CategoryPost from './profile/CategoryPage';
import CategoryRead from './profile/CategoryLoad';

import CategoryList from './test/CategoryList';
import CategoryDetail from './test/CategoryDetail';


function App() { 
  return (
    <div className="App">
      <Routes> 
        <Route path="/" element={<Home/>}/>
        <Route path="/blog" element={<Post/>}/> 
        <Route path="/blog/:folderName" element={<CategoryRead/>}/>
        <Route path="/blog/:folderName/:fileName" element={<Read/>}/>
        <Route path="/blog/:categoryName/:postName" element={<CategoryDetail />} />
      </Routes> 
    </div> 
  ); 
}


function Home() {
  return (
    <div>
      
      <br></br>
      <br></br>
      <h1>블로그의 홈 - 나를 소개합니다.</h1>
      <p>블로그 카테고리 글 선택 전의 홈</p>
      <a>게임개발의 끝을 마치긴 해야 함.</a>
  <CategoryData/>
    </div>
  );
}

export default App;
